INSERT INTO `answer` (`q_id`, `answer`, `description`, `a_id`) VALUES
(1, '10-12 Inches', 'The thinnest and lightest notebooks around have 10 to 12-inch screens. However, you may sacrifice keyboard size for portability.', 1),
(1, '13-14 Inches', 'Provides the best balance of portability and usability.', 2),
(1, '15 Inches', 'The most popular size, 15-inch laptops are the least expensive and provide plenty of desktop real estate. While most 15-inchers are easy to take from room to room, some are on the bulky side.', 3),
(1, '17-18 Inches', 'If your laptop stays on your desk all day, a 17- or 18-inch system will likely provide everything you need for work and play.', 4),
(2, 'Up to $400', 'Those in the market for a simple notebook for everyday tasks can find a capable machine for less than $400', 5),
(2, 'Up to $600', 't this price point, many systems have lower-res screens and graphics that aren’t good enough for gaming.', 6),
(2, 'Up to $1000', 'you’ll start to see more premium designs, such as metal finishes. Manufacturers also start to add in other features as you climb the price ladder, including higher-res screens,', 7),
(2, 'Above $1000', 'At this price range, expect notebooks that are more portable, more powerful or both.', 8),
(3, 'I don''t play games', 'Gaming is not your primary interest for this computer', 9),
(3, 'I play some flash and internet games', 'Games such as runescape, or other online games found on armorgames or miniclip', 10),
(3, 'I play mid-range graphical games', 'Games such as Dota, League of Legends, and most indie games. Also may play high-end games on lower settings.', 11),
(3, 'I play very hardware intense games', 'First person shooters and games such as the Witcher, Crysis ring a bell', 12),
(4, 'No', 'You aren''t intending to make or edit videos or photographs on this laptop ', 13),
(4, 'I occasionally do some video editing', 'You edit photos, and/or do very basic video editing (using photoshop, iMovie, etc)', 14),
(4, 'Yes, I do a lot of video editing', 'You are going to use high end video editing software and are using this laptop primarily for video editing (Adobe Premiere Pro, 3D software)', 15),
(5, 'Rarely', 'You tend to always be around a desk or power outlet and dont find it too much of a nuissance to carry a charger around with you', 16),
(5, 'Sometimes', 'You tend to be close to power outlets but prefer not to be plugged in unless you have to', 17),
(5, 'More than not', 'You use your laptop away from outlets, during your commute and dont like having to be tethered to a wall', 18),
(5, 'All the time', 'You are rarely near a wall outlet and require a laptop that is going to get you through the day without too much worry.', 19),
(6, 'Windows', 'You use windows based programs, and is the most common type of computer (tend to be less expensive)', 20),
(6, 'Mac ', 'Tha Apple brand, runs OSX (tend to be more expensive)', 21),
(6, 'ChromeOS', 'Mostly used for people that only need a browser, email, and basic office functions', 22),
(7, '128GB or less', 'The majority of your content will be on the cloud or using an external harddrive (not a lot of information)', 23),
(7, 'More than 128GB, but less than 512 GB', 'You use cloud services but want space to store documents on your computer', 24),
(7, 'Over 512GB of storage', 'You don''t use cloud services or use it very little, and have lots of data that you want stored ', 25),
(8, 'No preference', 'Doesn''t matter if it is a Hard Drive or Slid State Drive.', 26),
(8, 'Mid level speed, low cost, usually more storage', 'Hard drives (HDD) are your traditional form of storage in a laptop. They are offer a lot of storage (~500Gb) for reasonable price. Most mid-range laptops use hard drives as a form of storage.', 27),
(8, 'Fast speed, expensive, usually less storage', 'Solid State Drives (SSD) are a newer form of storage, which are significantly faster than traditional hard drives. This means that saving and transferring files is much faster, but come at a increased price. Most high-end laptops contain and SSD.', 28),
(9, 'No, I dont see myself using the touch screen.', 'Touch screen laptops tend to come with an increased price. If you do not see yourself using a touch screen or have a tablet as a secondary device, choose this option.', 29),
(9, 'Yes, I see myself using a touch screen often.', 'Touch screen laptops can be very handy for people who use their laptops for visual design or drawing. Though, touch screen laptops tend to be more expensive.', 30),
(10, 'No preference', 'You have no preference between a regular laptop or 2-in-one.', 31),
(10, 'Yes, I would like a 2-in-1 laptop', 'This is a new style, where the computers can fold behind or detach from the keyboard to allow for a tablet interface and layout. Usually more portable and light', 32),
(10, 'No, I want a regular laptop', 'This is your traditional laptop, no detachable keyboards or fold behind screens.', 33),
(11, 'The number of ports doesn''t matter to me', 'You don''t have many or any devices that need to be connected to the laptop at the same time', 34),
(11, 'I need to connect a lot of devices to my laptop', 'You need many ports to accomodate multiple displays, many USB devices, and an SD card reader, etc.', 35),
(12, 'Performance', 'You want your laptop to be running quick above anything else', 36),
(12, 'Battery life', 'Portability and battery life are essential in your future laptop', 37),
(12, 'Price', 'You are looking for a budget deal that still meets your needs', 38);

